import React from "react";
import { Flex, List, ListItem, LinkBox, Heading, LinkOverlay } from "@chakra-ui/react"

function Groups() {
    return (
        <Flex flexDir='column' bg='teal.500' flexGrow='0.1'>
            <List>
                {groups.map((item) => (
                    <>
                        <ListItem key={item} >
                            <LinkBox as='article' p='3' _hover={{ color: "white.500" }}>
                                <Heading size='md'>
                                    <LinkOverlay href={item.idGroup}>
                                        {item.Name}
                                    </LinkOverlay>
                                </Heading>
                            </LinkBox>
                        </ListItem>
                        <Divider />
                    </>
                ))}
            </List>
        </Flex>
    )
}

export default Groups;
